import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { createStackNavigator } from '@react-navigation/stack';

import DashboardScreen from '../screens/admin/DashboardScreen';
import SeriesScreen from '../screens/admin/SeriesScreen';
import SeriesAddScreen from '../screens/admin/SeriesAddScreen';
import SeriesEditScreen from '../screens/admin/SeriesEditScreen';
import EpisodesScreen from '../screens/admin/EpisodesScreen';
import EpisodeAddScreen from '../screens/admin/EpisodeAddScreen';
import EpisodeEditScreen from '../screens/admin/EpisodeEditScreen';
import UsersScreen from '../screens/admin/UsersScreen';
import AnalyticsScreen from '../screens/admin/AnalyticsScreen';

import AdminDashboardScreen from '../screens/admin/AdminDashboardScreen';
import ContentManagementScreen from '../screens/admin/ContentManagementScreen';
import SeriesListScreen from '../screens/admin/SeriesListScreen';
import SeasonsScreen from '../screens/admin/SeasonsScreen';
import PublishingScreen from '../screens/admin/PublishingScreen';
import SettingsScreen from '../screens/admin/SettingsScreen';

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const ContentStackNavigator = () => (
  <Stack.Navigator screenOptions={{ headerShown: false }}>
    <Stack.Screen name="ContentManagementHome" component={ContentManagementScreen} />
    <Stack.Screen name="SeriesList" component={SeriesListScreen} />
    <Stack.Screen name="Seasons" component={SeasonsScreen} />
    <Stack.Screen name="EpisodesList" component={EpisodesScreen} />
    <Stack.Screen name="SeriesAdd" component={SeriesAddScreen} />
    <Stack.Screen name="SeriesEdit" component={SeriesEditScreen} />
    <Stack.Screen name="EpisodeAdd" component={EpisodeAddScreen} />
    <Stack.Screen name="EpisodeEdit" component={EpisodeEditScreen} />
  </Stack.Navigator>
);

const AdminNavigator = () => (
  <Drawer.Navigator initialRouteName="AdminDashboard" screenOptions={{ headerShown: true }}>
    <Drawer.Screen name="AdminDashboard" component={AdminDashboardScreen} options={{ title: 'Dashboard' }}/>
    <Drawer.Screen name="ContentManagement" component={ContentStackNavigator} options={{ title: 'Content' }} />
    <Drawer.Screen name="Users" component={UsersScreen} options={{ title: 'Users' }} />
    <Drawer.Screen name="Analytics" component={AnalyticsScreen} options={{ title: 'Analytics' }} />
    <Drawer.Screen name="Publishing" component={PublishingScreen} options={{ title: 'Publishing' }} />
    <Drawer.Screen name="Settings" component={SettingsScreen} options={{ title: 'Settings' }} />
  </Drawer.Navigator>
);

export default AdminNavigator;
